--Creating repeatable code
IF OBJECT_ID('GameDetails') IS NOT NULL
    DROP TABLE GameDetails;
IF OBJECT_ID('Event') IS NOT NULL
    DROP TABLE Event;
IF OBJECT_ID('Teams') IS NOT NULL
    DROP TABLE Teams;
IF OBJECT_ID('Stadium') IS NOT NULL
    DROP TABLE Stadium;
IF OBJECT_ID('Division') IS NOT NULL
    DROP TABLE Division;
IF OBJECT_ID('Conference') IS NOT NULL
    DROP TABLE Conference;
--Creating conference
CREATE TABLE Conference (
ConferenceName char(3)
    --Constraint
    CONSTRAINT PK_Conference PRIMARY KEY (ConferenceName)
)
--Creating Division
CREATE TABLE Division (
DivisionName char(8),

ConferenceName char(3)
--Constraints

    CONSTRAINT PK_Division PRIMARY KEY (DivisionName),
    CONSTRAINT FK1_Conference FOREIGN KEY (ConferenceName)
REFERENCES Conference(ConferenceName)
)


--Creating Stadium

CREATE TABLE Stadium (
    StadiumID int identity,
    StadiumName char(50),
    Elevation int,
    Latitude decimal (5,1),
    StadiumWeatherType char(10),
    Longitude decimal (5,2)
    CONSTRAINT PK_Stadium PRIMARY KEY (StadiumID)
)


--Creating Teams

CREATE TABLE Teams (
    TeamID char(3),
    DivisionName char(8),
    TeamName varchar(30),
    StadiumID int
--Constraints
    CONSTRAINT PK_Teams PRIMARY KEY (TeamID),
    CONSTRAINT FK1_Teams FOREIGN KEY (DivisionName)
REFERENCES  Division(DivisionName),
    CONSTRAINT FK2_Teams FOREIGN KEY (StadiumID) 
REFERENCES Stadium(StadiumID)
)

--Creating Event

CREATE TABLE Event (

    EventID int identity,
    StadiumID int,
    ScheduleWeek int,
    TeamHome char(3),
    TeamAway char(3),
    SeasonYear int
CONSTRAINT PK_Event PRIMARY KEY (EventID),
CONSTRAINT FK1_Event FOREIGN KEY (StadiumID) REFERENCES
Stadium(StadiumID),
CONSTRAINT FK2_Event FOREIGN KEY (TeamHome) REFERENCES
Teams(TeamID),
CONSTRAINT FK3_Event FOREIGN KEY (TeamAway) REFERENCES
Teams(TeamID)
)

--Creates GameDetails
--Creating one to one relationship. Created INT UNIQUE FOREIGN KEY to do so
CREATE TABLE GameDetails (

    GameDetailsID int identity,
HomeScore int,
AwayScore int,
HomeFav char(5),
Temperature int,
WindMPH int,
OverUnder decimal (3,1),
FavTeamSpread decimal (3,1),
DidCover char(5),
OverOrUnder char(5),
EventID INT UNIQUE FOREIGN KEY REFERENCES Event(EventID),
CONSTRAINT PK_GameDetails PRIMARY KEY (GameDetailsID),
CONSTRAINT FK1_GameDetails FOREIGN KEY (EventID) REFERENCES Event(EventID)
)

--alter a table to include see if home team or away team is the favored team
ALTER TABLE GameDetails
ADD IsHomeFav char(5);
