--#1. Now let's see if the narrative that teams do not acheive the Over as much in the cold is true
SELECT COUNT(*) AS NumberColdGames FROM GameDetails 
WHERE  Temperature <33
--37 games where the temperature was under 32 or lower Fahrenheit.
SELECT COUNT(*) FROM GameDetails
WHERE OverOrUnder = 'Under' AND Temperature <33
/*   24/32 games went 'Under' when the temperature was 32 or lower
 This is a small sample but this may be interesting to look at
the proportion of games Under compared to all weather is much different
8/32 games went over during freezing conditions. 25% in the past 3 years of the NFL
*/
--#2 Let's see if Vegas prepares for such possible differences
SELECT AVG(OverUnder) AS AveragePoints FROM GameDetails
WHERE Temperature >= 33
--Average is 45.5 combined points for betting Over Or Under when its not freezing out
SELECT AVG(OverUnder) As ColdAverage FROM GameDetails
WHERE Temperature < 33
/*Average is 43.13 so it looks like Vegas isn't really changing expected points much
in our small sample but teams are not covering as much */


-- # 3 Let's see if the average Over or Under is different by weather type
-- In essence is Vegas making spreads higher when players play in domes
SELECT StadiumWeatherType, AVG(OverUnder)  AS AvgByWeatherType FROM (dbo.Teams JOIN Stadium ON
	Teams.StadiumID = Stadium.StadiumID
	JOIN Event ON Stadium.StadiumID = Event.StadiumID
	JOIN GameDetails ON Event.EventID= GameDetails.EventID)
GROUP BY StadiumWeatherType
