--# 4Let's see if these slight differences increase if we only look at week 12 on because then it will be cold outside
SELECT ScheduleWeek, StadiumWeatherType, AVG(OverUnder)  AS AvgByWeatherType FROM (dbo.Teams JOIN Stadium ON
	Teams.StadiumID = Stadium.StadiumID
	JOIN Event ON Stadium.StadiumID = Event.StadiumID
	JOIN GameDetails ON Event.EventID= GameDetails.EventID)
GROUP BY StadiumWeatherType, ScheduleWeek
HAVING ScheduleWeek >= 12
